import React from "react";

const Sresult = (prop) => {
    const img = `https://source.unsplash.com/1600x900/?${prop.name}`
    return (
      <>
     <div>
         <img src={img} alt="" />
     </div>
    
      </>
    )
  }
  export default Sresult;
